import { useState, useEffect } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import '../styles/ManageProperties.css'


const ManageProperties = () => {
  const [properties, setProperties] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filters, setFilters] = useState({
    status: ''
  });

  useEffect(() => {
    const fetchProperties = async () => {
      try {
        const res = await axios.get('/api/properties/landlord');
        setProperties(res.data);
      } catch (err) {
        console.error('Error fetching properties:', err);
      } finally {
        setLoading(false);
      }
    };
    
    fetchProperties();
  }, []);

  const deleteProperty = async (id) => {
    if (window.confirm('Are you sure you want to delete this property?')) {
      try {
        await axios.delete(`/api/properties/${id}`);
        setProperties(properties.filter(property => property._id !== id));
      } catch (err) {
        console.error('Error deleting property:', err);
      }
    }
  };
  
  const filteredProperties = filters.status 
    ? properties.filter(property => property.status === filters.status)
    : properties;

  if (loading) return <div>Loading your properties...</div>;

  return (
    <div className="manage-properties">
      <div className="header">
        <h1>Your Properties</h1>
        <Link to="/landlord/properties/new" className="btn-primary">
          Add New Property
        </Link>
      </div>
      
      <div className="filters">
        <select
          value={filters.status}
          onChange={(e) => setFilters({...filters, status: e.target.value})}
        >
          <option value="">All Statuses</option>
          <option value="available">Available</option>
          <option value="rented">Rented</option>
          <option value="sold">Sold</option>
        </select>
      </div>
      
      {filteredProperties.length > 0 ? (
        <table className="properties-table">
          <thead>
            <tr>
              <th>Title</th>
              <th>Price</th>
              <th>Location</th>
              <th>Status</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {filteredProperties.map(property => (
              <tr key={property._id}>
                <td>{property.title}</td>
                <td>${property.price}</td>
                <td>{property.location}</td>
                <td className={`status ${property.status}`}>
                  {property.status}
                </td>
                <td className="actions">
                  <Link
                    to={`/landlord/properties/${property._id}/edit`}
                    className="btn-edit"
                  >
                    Edit
                  </Link>
                  <button
                    onClick={() => deleteProperty(property._id)}
                    className="btn-delete"
                  >
                    Delete
                  </button>
                  <Link
                    to={`/landlord/properties/${property._id}/proposals`}
                    className="btn-proposals"
                  >
                    View Proposals
                  </Link>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>You haven't listed any properties yet</p>
      )}
    </div>
  );
};

export default ManageProperties;
